import React from 'react';
import styled from 'styled-components';

import NavItem from './NavItem';

const Footer = styled.footer`
	text-align: center;
	border-top: 1px solid #e2e8ed;
	height: 55px;
	position: absolute;
	bottom: 0px;
	left: 0px;
	width: 100%;

	&.white {
		background: #ffffff;
	}
	&.black {
		background: #0b0102;
	}
	&.hidden {
		display: none;
	}
`;

const footer = (props) => (
	<Footer className={props.status}>
		<NavItem type="listen" text="Listen" status={props.status} active={props.active === 'listen' ? true : false} />
		<NavItem type="watch" text="Watch" status={props.status} active={props.active === 'watch' ? true : false} />
		<NavItem type="price" text="Price" status={props.status} active={props.active === 'price' ? true : false} />
	</Footer>
)

export default footer;
